webpackJsonp([0x8db30e7d5878],{3267:function(e,n){e.exports={data:{markdownRemark:{html:'<h2>Network Utterance Environment</h2>\n<p>It is an open source blog / CMS system. The danmaq Web page has also been completely transferred from this handwritten blog using a conventional text editor to this system from June 23, 2011.</p>\n<h2>Characteristic</h2>\n<ul>\n<li>\n<p>You can use skins with extremely high degrees of freedom using XSLT.</p>\n</li>\n<li>\n<p>Nico Nico douga animated tag system is implemented. Furthermore, by hierarchizing tags, you can use tags directly as "table of contents" instead.</p>\n</li>\n<li>\n<p>You can customize the structure and appearance of articles by embedding tags using pseudo HTML in the article.</p>\n<h2>download</h2>\n</li>\n</ul>\n<ul>\n<li><a href="http://nue.sourceforge.jp/">You can download from SOURCEFORGE.JP</a></li>\n<li><a href="http://svn.sourceforge.jp/svnroot/nue/">SVN repository (readonly)</a></li>\n<li><a href="legacy/README">README</a></li>\n<li><a href="legacy/HISTORY">Update history (Nightly build)</a> operation sample is currently stopped. Instead <a href="legacy/">danmaqlassic is a de facto working sample</a> .</li>\n</ul>',frontmatter:{cover:null,date:"2011-06-01T15:00:00+09:00",strDate:"2011/6/1",title:"NUE - Blog / CMS system which allows for highly flexible skin with XSL"}}},pathContext:{path:"/en/blog/2011/06/01-nue/",langKey:"en"}}}});
